import React from "react";
import { FaSearch } from "react-icons/fa";
import "../styles/Navbar.css";

const Navbar = () => {
  return (
    <div className="flex justify-between px-4 h-[80px] ">
      <div className="search__input">
        <span>
          <FaSearch />
        </span>
        <input type="text" />
      </div>
      <div>
        <p>{"اربے"}</p>
      </div>
      <div>
        <div>
          <p>data1</p>
          <p>data2</p>
          <p>data3</p>
        </div>
      </div>
    </div>
  );
};

export default Navbar;
